import React from 'react';
import City from './City.js';
import data from '../assets/json/data.js';

class SecondContent extends React.Component {
    constructor(props) {
        this.imageOne = { imageOne: props.imageOne }
        this.imageTwo = { imageOne: props.imageTwo }
        this.imageThree = { imageOne: props.imageThree }
        this.imageFour = { imageFour: props.imageFour }
    }

    createTable() {
        var table = [];

        for (let i = 0; i < 4; i++) {
            table.push(
                <li key={i}>
                    <City src={this.getRandomImage()} />
                </li>
            );
        }

        return table;
    }

    getRandomImage() {
        return data[Math.round(Math.random() * data.length)].image;
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
            </div>
        );
    }
}

export default SecondContent;
